		["Adds marker + nameplate cast anchor"] = {
			["outline"] = "OUTLINE",
			["iconSource"] = -1,
			["color"] = {
				1, -- [1]
				1, -- [2]
				1, -- [3]
				1, -- [4]
			},
			["displayText"] = "%n",
			["customText"] = "function()\n    if aura_env.state and aura_env.state.cast then\n        if aura_env.config.glow and aura_env.config.specify > 0 then\n            if aura_env.state.cast == aura_env.config.specify\n            and (\n                aura_env.config.glowIcon[9] \n                or (aura_env.state.mark and aura_env.config.glowIcon[aura_env.state.mark])\n            )\n            then\n                WeakAuras.GetRegion(aura_env.id, aura_env.cloneId):SetGlow(true)\n            else\n                WeakAuras.GetRegion(aura_env.id, aura_env.cloneId):SetGlow(false)    \n            end\n        end\n        \n        local num = aura_env.state.cast > 0 and aura_env.state.cast or \"\"\n        return num\n    end\nend\n\n\n",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
			["cooldownSwipe"] = true,
			["customTextUpdate"] = "event",
			["cooldownEdge"] = false,
			["icon"] = true,
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_type"] = "stateupdate",
						["debuffType"] = "HELPFUL",
						["names"] = {
						},
						["event"] = "Health",
						["subeventPrefix"] = "SPELL",
						["subeventSuffix"] = "_CAST_START",
						["events"] = "NAME_PLATE_UNIT_ADDED NAME_PLATE_UNIT_REMOVED CLEU:SPELL_CAST_START:SPELL_CAST_SUCCESS:SPELL_AURA_APPLIED:SPELL_INTERRUPT:SPELL_CAST_FAILED:UNIT_DIED WA_NAMEPLATE_CLOSED CHAT_MSG_ADDON RAID_TARGET_UPDATE ENCOUNTER_START COS_MARK_CLEANER PLAYER_REGEN_ENABLED UNIT_THREAT_SITUATION_UPDATE",
						["custom"] = "function(states, event, ...)\n    if event == \"OPTIONS\" then\n        states[\"\"] = {\n            name = \"something\",\n            icon = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_8\",\n            cast = 1,\n            progressType = \"static\",\n            changed = true,\n            show = true,\n        }\n        return true\n    end\n    --reset stuff on encounter_start or at leaving combat when in group/solo\n    if aura_env.config.combatOnly and event == \"UNIT_THREAT_SITUATION_UPDATE\" and ... then\n        local check = ...\n        if check == \"player\" then\n            for i = 1, 40 do\n                local unit = \"nameplate\" .. i\n                if UnitExists(unit)\n                and UnitThreatSituation(\"player\", unit)\n                then\n                    local npcID = select(6, strsplit(\"-\", UnitGUID(unit)))\n                    if aura_env.npcIDs[npcID] then\n                        C_Timer.After(0.1, function() WeakAuras.ScanEvents(\"NAME_PLATE_UNIT_ADDED\", unit) end)\n                    end\n                end\n            end\n        end\n    end\n    \n    if event == \"ENCOUNTER_START\"\n    or (event == \"PLAYER_REGEN_ENABLED\" and not IsEncounterInProgress() and not IsInRaid())\n    then\n        aura_env.castNum = {}\n        aura_env.adds = {}\n        aura_env.saved = {}\n        aura_env.counter = 1\n        for i = 1, 40 do\n            local unit = \"nameplate\" .. i\n            if UnitExists(unit)\n            and (aura_env.config.combatOnly and UnitThreatSituation(\"player\", unit) or not aura_env.config.combatOnly)\n            and UnitCanAttack(\"player\", unit)\n            then\n                local npcID = select(6, strsplit(\"-\", UnitGUID(unit)))\n                if aura_env.npcIDs[npcID] then\n                    C_Timer.After(0.1, function() WeakAuras.ScanEvents(\"NAME_PLATE_UNIT_ADDED\", unit) end)\n                end\n            end\n        end\n    end\n    \n    --reassign stored adds if some other add died\n    if event == \"COS_MARK_CLEANER\" and ... then\n        local free = ...\n        local t = {}\n        for _, status in pairs(aura_env.adds) do\n            if status[2] == \"stored\"\n            and status[3]\n            then\n                table.insert(t, status)\n            end\n        end\n        table.sort(t, function(a,b) return a[3] < b[3] end)\n        if t[1] then t[1][1] = free t[1][2] = \"set\" end\n        C_Timer.After(0.1, function() WeakAuras.ScanEvents(\"RAID_TARGET_UPDATE\") end)\n    end\n    \n    --marking with addon message\n    if event == \"CHAT_MSG_ADDON\"\n    and aura_env.config.setMarks\n    and (\n        (aura_env.config.raidMarking and IsInRaid())\n        or (aura_env.config.groupMarking and IsInGroup())\n        or (aura_env.config.soloMarking and not IsInGroup() and not IsInRaid())\n    )\n    then\n        local prefix, message = ...\n        if prefix == \"COS_WA_SEND_MARK\"\n        and message\n        then\n            local unit, GUID, myGUID, npcID = strsplit(\"*\", message)\n            if not aura_env.adds[GUID]\n            and aura_env.npcIDs[npcID]\n            and aura_env.npcIDs[npcID][\"marks\"]\n            and #aura_env.npcIDs[npcID][\"marks\"] > 0\n            then --check if add is already catched and marks are set\n                if aura_env.counter%(#aura_env.npcIDs[npcID][\"marks\"]+1) == 0 then\n                    aura_env.counter = aura_env.counter+1\n                end\n                local mark = aura_env.npcIDs[npcID][\"marks\"][aura_env.counter%(#aura_env.npcIDs[npcID][\"marks\"]+1)]\n                local count = 0\n                local pass = false\n                for adds in pairs(aura_env.adds) do\n                    count = count + 1\n                end\n                if count >= #aura_env.npcIDs[npcID][\"marks\"] then\n                    aura_env.adds[GUID] = {mark, \"stored\", GetTime()}\n                else\n                    aura_env.adds[GUID] = {mark, \"set\"}\n                    pass = true\n                end\n                aura_env.counter = aura_env.counter + 1\n                if pass and WeakAuras.myGUID == myGUID then\n                    local check = GetRaidTargetIndex(unit)\n                    if not check or check ~= mark then\n                        SetRaidTarget(unit, mark)\n                        if states[GUID] then\n                            states[GUID].mark = mark\n                            states[GUID].icon = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_\"..mark\n                            states[GUID].changed = true\n                        end\n                    elseif check == mark and states[GUID] then\n                        states[GUID].mark = mark\n                        states[GUID].icon = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_\"..mark\n                        states[GUID].changed = true\n                    end\n                end\n            end\n        end\n    end\n    \n    --place new marks after reassigning or if fasten is enabled\n    if event == \"RAID_TARGET_UPDATE\"\n    and (aura_env.config.anchor or aura_env.config.setMarks)\n    then\n        for i = 1, 40 do\n            local unit = \"nameplate\" .. i\n            if UnitExists(unit)\n            and (aura_env.config.combatOnly and UnitThreatSituation(\"player\", unit) or not aura_env.config.combatOnly)\n            and UnitCanAttack(\"player\", unit)\n            then\n                local npcID = select(6, strsplit(\"-\", UnitGUID(unit)))\n                if aura_env.npcIDs[npcID] then\n                    local GUID = UnitGUID(unit)\n                    local check = GetRaidTargetIndex(unit)\n                    if aura_env.config.setMarks and aura_env.adds[GUID] then\n                        if aura_env.adds[GUID][2] == \"set\" and (not check or (check and aura_env.adds[GUID][1] ~= check)) then\n                            C_Timer.After(0.3, function() WeakAuras.ScanEvents(\"NAME_PLATE_UNIT_ADDED\", unit) end)\n                        end\n                    elseif not aura_env.config.setMarks and aura_env.config.anchor then\n                        local state = states[GUID]\n                        if state then\n                            if check and (not state.mark or state.mark ~= check) then\n                                state.icon = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_\"..check\n                                state.mark = icon\n                                state.changed = true\n                            elseif not check and state.icon ~= aura_env.texture then\n                                state.icon = aura_env.texture\n                                state.mark = nil\n                                state.changed = true\n                            end\n                        end\n                    end\n                end\n            end\n        end\n    end\n    \n    --catching nameplate events\n    if event == \"NAME_PLATE_UNIT_ADDED\"\n    and (aura_env.config.anchor or aura_env.config.setMarks)\n    then\n        local unit = ...\n        if unit and UnitExists(unit) then\n            local GUID = UnitGUID(unit)\n            local npcID = select(6, strsplit(\"-\", GUID))\n            if aura_env.npcIDs[npcID] then\n                local cast = 0\n                if aura_env.config.anchor then\n                    if aura_env.config.showCasts == 1 then\n                        local inProgress = aura_env.npcIDs[npcID][\"castID\"][spellid] == \"channel\" and UnitChannelInfo or UnitCastingInfo\n                        if inProgress(unit) and aura_env.castNum[GUID] then\n                            cast = aura_env.castNum[GUID][1]\n                        else\n                            cast = aura_env.castNum[GUID] and aura_env.castNum[GUID][1]+1 or 1\n                        end\n                        if aura_env.config.resetAfter > 0 then\n                            local result = cast%aura_env.config.resetAfter\n                            cast = result == 0 and aura_env.config.resetAfter or result\n                        end\n                    elseif aura_env.config.showCasts == 2 then\n                        local inProgress = aura_env.npcIDs[npcID][\"castID\"][spellid] == \"channel\" and UnitChannelInfo or UnitCastingInfo\n                        if inProgress(unit) and aura_env.castNum[GUID] then\n                            cast = aura_env.castNum[GUID][1]\n                            if aura_env.config.resetAfter > 0 then\n                                local result = cast%aura_env.config.resetAfter\n                                cast = result == 0 and aura_env.config.resetAfter or result\n                            end\n                        end\n                    end\n                end\n                \n                local assist, setMarks = false, aura_env.config.setMarks\n                local inRaid = setMarks and aura_env.config.raidMarking and IsInRaid()\n                local inGroup = setMarks and aura_env.config.groupMarking and IsInGroup()\n                local solo = setMarks and aura_env.config.soloMarking and not IsInGroup() and not IsInRaid()\n                \n                if inRaid and (UnitIsGroupLeader(\"player\") or UnitIsGroupAssistant(\"player\"))\n                or inGroup or solo\n                then\n                    assist = true\n                end\n                \n                local mark = GetRaidTargetIndex(unit)\n                local icon\n                local combat = (aura_env.config.combatOnly and UnitThreatSituation(\"player\", unit) or not aura_env.config.combatOnly)\n                \n                if assist and combat then --marking allowed\n                    if aura_env.config.fastenMarks\n                    and aura_env.adds[GUID]\n                    and aura_env.adds[GUID][2] == \"set\"\n                    then --fasten marks\n                        icon = aura_env.adds[GUID][1]\n                        if not mark or mark ~= aura_env.adds[GUID][1] then\n                            if aura_env.config.checkAuras then\n                                local auraType = aura_env.npcIDs[npcID][\"auraType\"]\n                                local check = aura_env.GetUnitAura(unit, npcID, auraType)\n                                if check then\n                                    SetRaidTarget(unit, aura_env.adds[GUID][1])\n                                else\n                                    aura_env.saved[GUID] = {unit, aura_env.npcIDs[npcID][\"auraID\"]}\n                                end\n                            else\n                                SetRaidTarget(unit, aura_env.adds[GUID][1])\n                            end\n                        end\n                    elseif not aura_env.adds[GUID] then --storing adds\n                        if aura_env.config.checkAuras then --check for auras if set\n                            local auraType = aura_env.npcIDs[npcID][\"auraType\"]\n                            local check = aura_env.GetUnitAura(unit, npcID, auraType)\n                            if check then\n                                local message = unit..\"*\"..GUID..\"*\"..WeakAuras.myGUID..\"*\"..npcID\n                                if inRaid then\n                                    C_ChatInfo.SendAddonMessage(\"COS_WA_SEND_MARK\", message, \"RAID\")\n                                elseif inGroup then\n                                    C_ChatInfo.SendAddonMessage(\"COS_WA_SEND_MARK\", message, \"PARTY\")\n                                elseif solo then\n                                    C_ChatInfo.SendAddonMessage(\"COS_WA_SEND_MARK\", message, \"WHISPER\", WeakAuras.me)\n                                end\n                            else\n                                aura_env.saved[GUID] = {unit, aura_env.npcIDs[npcID][\"auraID\"]}\n        