sType = \"static\",\n                            value = 0,\n                            total = 0,\n                            cast = cast,\n                            autoHide = \"false\",\n                            changed = true,\n                            show = true,\n                        }\n                    elseif states[GUID]\n                    and icon\n                    and states[GUID].icon == aura_env.texture\n                    then\n                        states[GUID].mark = icon\n                        states[GUID].icon = \"Interface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_\"..icon\n                        states[GUID].changed = true\n                    end\n                end\n                \n            end\n        end\n    elseif event == \"NAME_PLATE_UNIT_REMOVED\"\n    and aura_env.config.anchor\n    then --kill state if anchor enabled\n        local unit = ...\n        if unit then\n            local GUID = UnitGUID(unit)\n            if states[GUID] then\n                states[GUID].show = false\n                states[GUID].changed = true\n            end\n            if aura_env.saved[GUID] then\n                aura_env.saved[GUID] = nil\n            end\n        end\n    end\n    \n    --CLEU cast counter / aura checker\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\"  then \n        local _, message, _, srcGUID, srcName, _, srcRaidFlags, destGUID, destName, _, destRaidFlags, spellid, spellName, spellSchool, arg1 = ...\n        if aura_env.config.anchor\n        and message == \"SPELL_CAST_START\"\n        then --cast spells\n            local npcID = select(6, strsplit(\"-\", srcGUID))\n            if aura_env.npcIDs[npcID]\n            and aura_env.npcIDs[npcID][\"castID\"]\n            and aura_env.npcIDs[npcID][\"castID\"][spellid]\n            and aura_env.npcIDs[npcID][\"castID\"][spellid] == \"cast\"\n            then\n                if not aura_env.castNum[srcGUID] then\n                    aura_env.castN