			["actions"] = {
				["start"] = {
					["sound"] = "Interface\\AddOns\\WIM\\Sounds\\chat.ogg",
					["do_custom"] = true,
					["custom"] = "if aura_env.state and aura_env.state.frame then\n    aura_env.region:SetAnchor(\n        aura_env.anchorPoint[aura_env.config.texPoint], \n        aura_env.state.frame,\n        aura_env.anchorPoint[aura_env.config.platePoint]\n    )\n    aura_env.region:SetOffset(\n        aura_env.config.xOffset,\n        aura_env.config.yOffset\n    )\nend\n\n\n",
