				},
				["finish"] = {
					["custom"] = "\n\n\n\n\n\n\n\n\n\n\n\n\n",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "--marks: 1=star, 2=circle, 3=diamond, 4=triangle, 5=moon, 6=square, 7=cross, 8=skull\n\naura_env.npcIDs = {\n    --[[ example\n    [\"123456\"] = { --NPC id (string, i.e. \"123456\" in quotes)\n        [\"auraType\"] = \"debuff\", -- \"buff\", \"debuff\" if using [Set marks on buffed/debuffed adds] or false\n        [\"auraID\"] = {\n            [1234] = true, --aura spellid 1, if [1] \"buff\" or \"debuff\" \n            [5678] = true, --aura spellid 2, if [1] \"buff\" or \"debuff\" (if exists)\n        },\n        [\"castID\"] = {\n            [9876] = \"channel\", --channel spellid 1 (if exists)\n            [5431] = \"cast\", --cast spellid 2 (if exists)\n        },\n        [\"marks\"] = {1, 2, 3, 4, 5, 6, 7, 8}, --mark numbers\n    }, \n    ]]--\n    [\"153090\"] = { --Lady Venomtongue\n        [\"auraType\"] = false,\n        [\"auraID\"] = {\n        },\n        [\"castID\"] = {\n            [297972] = \"cast\", --Chain Lightning\n            [300491] = \"cast\", --Drain Ancient Ward\n            [300490] = \"cast\", --Energize Ward of Power\n        },\n        [\"marks\"] = {1, 2, 3}, --star, circle, diamond\n    }, \n    [\"153091\"] = { --Serena Scarscale\n        [\"auraType\"] = false,\n        [\"auraID\"] = {\n        },\n        [\"castID\"] = {\n            [297972] = \"cast\", --Chain Lightning\n            [300491] = \"cast\", --Drain Ancient Ward\n            [300490] = \"cast\", --Energize Ward of Power\n        },\n        [\"marks\"] = {1, 2, 3}, --star, circle, diamond\n    }, \n    [\"32545\"] = { --Serena Scarscale\n        [\"auraType\"] = false,\n        [\"auraID\"] = {\n        },\n        [\"castID\"] = {\n            [297972] = \"cast\", --Chain Lightning\n            [300491] = \"cast\", --Drain Ancient Ward\n            [300490] = \"cast\", --Energize Ward of Power\n        },\n        [\"marks\"] = {1, 2, 3}, --star, circle, diamond\n    }, \n}\n\naura_env.texture = \"Interface\\\\AddOns\\\\WeakAuras\\\\Media\\\\Textures\\\\Circle_White_Border\"\n\naura_env.castNum = {}\naura_env.clones = {}\naura_env.adds = {}\naura_env.saved = {}\naura_env.counter = 1\n\naura_env.soundList = {\n    [1] = \"Interface\\\\addons\\\\WeakAuras\\\\Media\\\\Sounds\\\\AirHorn.ogg\", --AirHorn\n    [2] = \"Interface\\\\addons\\\\WeakAuras\\\\Media\\\\Sounds\\\\CowMooing.ogg\", --Cow mooing\n    [3] = \"Interface\\\\addons\\\\WeakAuras\\\\Media\\\\Sounds\\\\Next.ogg\", --Voice: next\n    [4] = \"Interface\\\\addons\\\\WeakAuras\\\\Media\\\\Sounds\\\\RingingPhone.ogg\", --Ringing Phone\n    [5] = \"Interface\\\\addons\\\\WeakAuras\\\\PowerAurasMedia\\\\Sounds\\\\phone.ogg\", --Phone\n    [6] = \"Interface\\\\addons\\\\WeakAuras\\\\PowerAurasMedia\\\\Sounds\\\\Bam.ogg\", --Bam!\n    [7] = \"Interface\\\\addons\\\\WeakAuras\\\\PowerAurasMedia\\\\Sounds\\\\BITE.ogg\", --Bite\n    [8] = \"Interface\\\\addons\\\\WeakAuras\\\\PowerAurasMedia\\\\Sounds\\\\cat2.ogg\", --Cat meow\n    [9] = \"Interface\\\\addons\\\\WeakAuras\\\\PowerAurasMedia\\\\Sounds\\\\ESPARK1.ogg\", --Electrical spark\n    [10] = \"Interface\\\\addons\\\\WeakAuras\\\\PowerAurasMedia\\\\Sounds\\\\panther1.ogg\", --Panther\n}\n\naura_env.markers = {\n    [128] = 8, -- skull\n    [64] = 7, -- cross\n    [32] = 6, -- square\n    [16] = 5, -- moon\n    [8] = 4, -- triangle\n    [4] = 3, -- diamond\n    [2] = 2, -- circle\n    [1] = 1, -- star\n}\n\naura_env.anchorPoint = {\n    [1] = \"BOTTOM\",\n    [2] = \"BOTTOMLEFT\",\n    [3] = \"BOTTOMRIGHT\",\n    [4] = \"CENTER\",\n    [5] = \"LEFT\",\n    [6] = \"RIGHT\",\n    [7] = \"TOP\",\n    [8] = \"TOPLEFT\",\n    [9] = \"TOPRIGHT\",\n}\n\naura_env.GetUnitAura = function(unit, npcID, auraType)\n    if not unit\n    or not npcID\n    or not aura_env.npcIDs[npcID][\"auraID\"]\n    then\n        return false\n    end\n    local check = auraType == \"debuff\" and UnitDebuff or auraType == \"buff\" and UnitBuff or false\n    if not check then return false end\n    for i = 1, 40 do\n        local name, _, _, _, _, _, _, _, _, spellId = check(unit, i)\n        if not name then return end\n        if aura_env.npcIDs[npcID][\"auraID\"][name] or aura_env.npcIDs[npcID][\"auraID\"][spellId] then\n            return check(unit, i)\n        end\n    end\nend\n\nC_ChatInfo.RegisterAddonMessagePrefix(\"COS_WA_SEND_MARK\")",
