		["AutoMarker"] = {
			["outline"] = "OUTLINE",
			["xOffset"] = 0,
			["preferToUpdate"] = false,
			["customText"] = "\n\n",
			["shadowYOffset"] = -1,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "event",
			["automaticWidth"] = "Auto",
			["actions"] = {
				["start"] = {
					["custom"] = "\n\n",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "aura_env.preScanComplete = false\naura_env.usedMarkers = {} -- Table containing pairs of GUID and mark\naura_env.markers = {} -- Populated from User Options\naura_env.playerZone = \"0\"\n\n-- Create a list of targets to scan for pre-placed markers on\naura_env.preScan = { \"player\" }\nfor i = 1,4 do\n    table.insert(aura_env.preScan, \"party\"..i)\nend\nfor i = 1,40 do\n    table.insert(aura_env.preScan, \"nameplate\"..i)\nend\n\n-- Create list of allowed markers\nfor markerID, active in pairs(aura_env.config[\"markers\"]) do\n    if active then\n        table.insert(aura_env.markers, tonumber(markerID))\n    end\nend\ntable.sort(aura_env.markers) -- Sort the list so that markers always go out in deterministic order. Silly LUA.\n\n-- Simple function that returns the first free (unused) marker\naura_env.GetFirstFreeMarker = function()\n    for _, candidate in ipairs(aura_env.markers) do\n        local valid = true\n        \n        for _, p in pairs(aura_env.usedMarkers) do\n            if candidate == p then\n                valid = false\n                break\n            end\n        end\n        \n        if valid then\n            return candidate\n        end\n    end\n    \n    -- No free markers\n    return 0\nend\n\n-- Function that marks a given target if it's in the list and a marker is free\naura_env.CheckAndMark = function(target)\n    local uGUID = UnitGUID(target)\n    \n    if uGUID then\n        local hasMark = GetRaidTargetIndex(target)\n        local npcId = select(6, strsplit(\"-\", uGUID))\n        \n        -- Check for a mark that has already been placed locally.\n        if aura_env.usedMarkers[uGUID] then\n            return\n        end\n        \n        -- Another person or addon has marked this target, leave it be\n        if hasMark then\n            aura_env.usedMarkers[uGUID] = hasMark\n            return\n        end\n        \n        if npcId then\n            if aura_env.config[aura_env.playerZone][npcId] or aura_env.config[\"season\"][npcId] then\n                local mark = aura_env.GetFirstFreeMarker()\n                \n                if mark then\n                    SetRaidTarget(target, mark)\n                    aura_env.usedMarkers[uGUID] = mark\n                end\n            end\n        end\n    end\nend",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_hide"] = "timed",
						["unevent"] = "timed",
						["subeventPrefix"] = "SPELL",
						["duration"] = "",
						["event"] = "Combat Log",
						["unit"] = "player",
						["subeventSuffix"] = "_CAST_START",
						["custom"] = "function(event, ...)\n    if event == \"PLAYER_REGEN_ENABLED\" then\n        wipe(aura_env.usedMarkers)\n        aura_env.preScanComplete = false\n        \n    elseif event == \"PLAYER_REGEN_DISABLED\" then\n        -- Create list of pre-placed markers\n        for _,v in ipairs(aura_env.preScan) do\n            local mark = GetRaidTargetIndex(v)\n            if mark then\n                local newGUID = UnitGUID(v)\n                aura_env.usedMarkers[newGUID] = mark\n            end\n        end\n        \n        aura_env.preScanComplete = true\n        \n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subEvent = select(2, ...)\n        local destGUID = select(8, ...)\n        \n        if subEvent == \"UNIT_DIED\" then           \n            -- Free up usedMarkers from marked targets who died\n            if aura_env.usedMarkers[destGUID] then\n                -- Freeing up the table by setting to nil doesn't seem to work in Blizzards LUA\n                aura_env.usedMarkers[destGUID] = 0    \n            end\n        end\n    end\n    \n    return true\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
						["events"] = "PLAYER_REGEN_ENABLED,PLAYER_REGEN_DISABLED,COMBAT_LOG_EVENT_UNFILTERED",
						["spellIds"] = {
						},
						["check"] = "event",
						["names"] = {
						},
						["custom_type"] = "event",
						["debuffType"] = "HELPFUL",
					},
					["untrigger"] = {
						["custom"] = "\n\n\n\n\n\n\n\n\n\n",
					},
				}, -- [1]
				{
					["trigger"] = {
						["type"] = "custom",
						["unevent"] = "timed",
						["duration"] = "",
						["event"] = "Combat Log",
						["unit"] = "player",
						["custom_hide"] = "timed",
						["events"] = "UNIT_AURA,UPDATE_MOUSEOVER_UNIT",
						["custom"] = "function(event, ...)\n    -- Events that can result in marks being placed\n    \n    -- Don't mark if not leader. We really shouldn't even load the WA, but there's no leader condition.\n    if not UnitIsGroupLeader(\"player\") then    \n        return\n    end\n    \n    aura_env.playerZone = tostring(select(8, GetInstanceInfo()))\n    \n    if event == \"UPDATE_MOUSEOVER_UNIT\" then\n        -- Mark eligible targets under the mouse when shift is held, no matter combat status\n        if aura_env.config[\"misc\"][\"promisc\"] or IsShiftKeyDown() then\n            aura_env.CheckAndMark(\"mouseover\")\n        end\n        \n    elseif event == \"UNIT_AURA\" then\n        -- An event that fires reasonably often, but not as often as every frame\n        if aura_env.preScanComplete then\n            -- Loop through the visible nameplates for something to mark\n            for i = 1,40 do\n                local target = \"nameplate\"..i\n                if UnitAffectingCombat(target) then\n                    aura_env.CheckAndMark(target)\n                end\n            end\n        end\n    end\n    return true\nend\n\n\n",
