			["customText"] = "function () \n    local name,_,icon,_,_,_,_,_,_,_,_,_,_,_,value=UnitBuff(\"player\", \"Vengeance\")\n    if not value then\n        value=0\n    end\n    if(value > 999999) then value = string.format(\"%.2fM\", ((value*1000000)/1000000)/1000000) \n    elseif(value > 99999) then value = math.floor(value/1000) .. \"k\" \n    end\n    return value \nend",
