						["names"] = {
							"Vengeance", -- [1]
						},
						["customDuration"] = "function ()\n    -- Get current Vengeance value\n    local name,_,icon,_,_,_,_,_,_,_,_,_,_,_,value=UnitBuff(\"player\", \"Vengeance\")\n    -- Get target of target Vengeance value\n    local name,_,icon,_,_,_,_,_,_,_,_,_,_,_,value2=UnitBuff(\"targettarget\", \"Vengeance\")\n    \n    -- Get maximum health\n    local maxHealth = UnitHealthMax(\"player\")\n    \n    -- correct for nil return value\n    if not value then\n        value = 0\n    end\n    if not value2 then\n        value2 = 0\n    end\n    \n    -- this next section calculates a reasonable display maximum\n    local stepSize = 50000\n    -- first, find the maximum of both tanks' Vengeance\n    local currentMaxValue = max(value,value2)\n    \n    -- set the max bar length\n    local maxValue = stepSize\n    \n    -- this block handles decay, so that the bar doesn't \n    -- jump around when you're near a threshold\n    if THECK_VBAR_LAST_ADJUST  and ( time() - THECK_VBAR_LAST_ADJUST) > 15 then\n        local maxValue = THECK_VBAR_LAST_VAL\n    end\n    \n    -- if the current maximum Vengeance exceeds 80% of our bar length,\n    -- make the bar longer\n    while  currentMaxValue > ( maxValue * 0.8 ) do\n        maxValue = maxValue + stepSize\n        THECK_VBAR_LAST_ADJUST = time() -- decay time global variable\n    end\n    \n    -- cap the bar at max health\n    maxValue = min( maxValue, maxHealth )\n    \n    -- store the bar length in a global variable for decay\n    THECK_VBAR_LAST_VAL = maxValue\n    \n    -- set progress bar to value / maxValue\n    return value, maxValue, true\n    \nend",
