			["preferToUpdate"] = false,
			["customText"] = "function()\n    if WeakAuras.IsOptionsOpen() then\n        return 1, \"\", \"123K\"\n    end\n    \n    if aura_env.state.show then\n        local options = WeakAuras.IsOptionsOpen()\n        aura_env.sortAndOffset(options)\n        \n        if options then\n            \n        end\n        \n        local tooltip = options and 123456 or aura_env.state.tooltip1\n        \n        local stacks = aura_env.state.stacks\n        stacks = stacks and stacks > 0 and stacks or \"\"\n        \n        local duration, expirationTime = aura_env.state.duration, aura_env.state.expirationTime\n        if duration == 0 or expirationTime == 0 then\n            return \"\", stacks , tooltip and aura_env.formatNumber(tooltip) or \"\"\n        else\n            return stacks , \"\", tooltip and aura_env.formatNumber(tooltip) or \"\"\n        end\n    end\nend",
			["yOffset"] = 0,
			["anchorPoint"] = "CENTER",
