					["do_custom"] = true,
				},
				["init"] = {
					["custom"] = "local c = aura_env.config\nlocal parent = aura_env.region\nlocal sort = function(a,b) return a.state.expirationTime > b.state.expirationTime end\naura_env.sortAndOffset = function(options)\n    local spacing = 4\n    local count = options and 1 or 0\n    local t = {}\n    \n    for k, v in pairs(WeakAuras.clones[aura_env.id]) do\n        if v.state and v.state.show and v.state.expirationTime then\n            table.insert(t, v)\n        end\n    end\n    table.sort(t, sort)\n    \n    for i, region in pairs(t) do\n        if region.toShow then\n            local xOffset = 0\n            local yOffset = 0\n            \n            if c.direction == 1 then --BOTTOM\n                xOffset = 0\n                yOffset = 0 - ((region.height + spacing) * count)\n            elseif c.direction == 2 then --TOP\n                xOffset = 0\n                yOffset = 0 + ((region.height + spacing) * count)\n            elseif c.direction == 3 then --LEFT\n                xOffset = 0 - ((region.width + spacing) * count)\n                yOffset = 0\n            elseif c.direction == 4 then --RIGHT\n                xOffset = 0 + ((region.width + spacing) * count)\n                yOffset = 0\n            end\n            \n            region:SetAnchor(\"CENTER\" , parent, \"CENTER\")\n            region:SetOffset(xOffset, yOffset)\n            \n            count = count + 1\n        end\n    end\nend\n\naura_env.formatNumber = function(value)\n    if not value or type(value) ~= \"number\" then return end\n    if c.format == 1 then\n        if value > 999999999 then\n            value = string.format(\"%.2fB\", value/1000000000)\n        elseif value > 999999 then\n            value = string.format(\"%.2fM\", value/1000000)   \n        elseif value > 99999 then\n            value = string.format(\"%.0fK\", value/1000)\n        elseif value > 999 then\n            value = string.format(\"%.1fK\", value/1000)\n        elseif value <= 0 then\n            value = 0\n        end \n    else\n        if value > 999999999 then\n            value = (\"%d,%03d,%03d,%03d\"):format(floor(value/1000000000), floor(value/1000000)%1000, floor(value/1000)%1000, value%1000)\n        elseif value > 999999 then\n            value = (\"%d,%03d,%03d\"):format(floor(value/1000000), floor(value/1000)%1000, value%1000)\n        elseif value > 999 then\n            value = (\"%d,%03d\"):format(floor(value/1000), value%1000)\n        elseif value <= 0 then\n            value = 0\n        end\n    end\n    \n    return value\nend\n\n\n\n\n\n\n",
